import { useState } from 'react';
import { Listbox } from '@headlessui/react';

const guests = [
    { id: 1, name: 'One Guest', unavailable: false },
    { id: 2, name: 'Two Guests', unavailable: false },
]

function Dropdown() {
    const [selectedGuest, setSelectedGuest] = useState(guests[0])

    return (
        <Listbox value={selectedGuest} onChange={setSelectedGuest}>
            <Listbox.Button>How many guests?</Listbox.Button>
            <Listbox.Options>
                {guests.map((guest) => (
                    <Listbox.Option
                        key={guest.id}
                        value={guest}
                        disabled={guest.unavailable}
                    >
                        {guest.name}
                    </Listbox.Option>
                ))}
            </Listbox.Options>
        </Listbox>
    )
}

export default Dropdown;
